import React from 'react'
import Shopify from '../assets/shopify.png'

const Sponsor = () => {
  return (
    <div className="bg-gray-300/30 w-full h-28 translate-y-60 flex justify-center items-center">
        <div className="flex justify-evenly">
            <img src={Shopify} className='w-48 h-16' />
        </div>
    </div>
  )
}

export default Sponsor
